import Nav from "./components/Nav";

function App() {
  const { characters, setCharacters } = useState();
  const onSearch = () => {};
  // const onClose = () => {};
  return (
    <div className="App" style={{ padding: "25px" }}>
      <div></div>
      <hr />
      <div>
        <Cards characters={characters} />
      </div>
      <hr />
      <div>
        <Nav onSearch={onSearch} />
      </div>
    </div>
  );
}

export default App;
